import React from 'react';
import AuthOptions from './AuthOptions';

const Hero = () => {
  
  return (
    <section className = 'hero'>
      <div className = 'main'>
        <div className="container-1">
          <AuthOptions />
        </div>
      </div>
    </section>
  );
}

export default Hero;
